import React from 'react';
import { Link, useNavigate } from 'react-router-dom';
import { useAuth } from '../hooks/useAuth';

const Navbar = () => {
  const { user, logout } = useAuth();
  const navigate = useNavigate();

  const handleLogout = () => {
    logout();
    navigate('/login');
  };

  return (
    <nav className="bg-white shadow-lg">
      <div className="container mx-auto px-4">
        <div className="flex justify-between items-center py-4">
          <Link to="/" className="text-2xl font-bold text-primary">
            Skill Swap Platform
          </Link>

          {user ? (
            <div className="flex items-center space-x-6">
              <Link to="/browse" className="text-gray-700 hover:text-primary">Browse</Link>
              <Link to="/skills" className="text-gray-700 hover:text-primary">My Skills</Link>
              <Link to="/swaps" className="text-gray-700 hover:text-primary">Swaps</Link>
              <Link to="/profile" className="text-gray-700 hover:text-primary">Profile</Link>
              <button 
                onClick={handleLogout}
                className="bg-red-500 text-white px-4 py-2 rounded hover:bg-red-600"
              >
                Logout
              </button>
            </div>
          ) : (
            <div className="flex items-center space-x-4">
              <Link to="/login" className="text-gray-700 hover:text-primary">Login</Link>
              <Link to="/register" className="bg-primary text-white px-4 py-2 rounded hover:bg-blue-600">
                Sign Up
              </Link>
            </div>
          )}
        </div>
      </div>
    </nav>
  );
};

export default Navbar;
